import React from 'react';

class Footer extends React.Component {
	render() {
		return (
			<React.Fragment>
				<div className='container py-5'>
					<div className='row'>
						<div className='col mx-auto text-center text-slanted my-5'>
							col-1
						</div>
						<div className='col mx-auto text-left text-slanted my-5'>
							<h6 className='font-weight-semibold'>Shopping online</h6>
						</div>
						<div className='col mx-auto text-center text-slanted my-5'>
							col-3
						</div>
						<div className='col mx-auto text-center text-slanted my-5'>
							col-4
						</div>

					</div>
				</div>
			</React.Fragment>
		)
	}
}

export default Footer;
